INSERT INTO `lab_profile_masters` (`id`, `lab_id`, `labbranch_id`, `about`, `services`, `packages`, `photo1`, `photo2`, `photo3`, `photo4`, `photo5`, `created_at`, `updated_at`) VALUES
(1, 1, 1, '\r\nAbout Us\r\n\r\nBrief History\r\n\r\nThe journey of Vijaya Labs started way back in 1989 as a small clinic, where Dr G Surender Rao practised paediatrics. With his international education and experience he became one of Hyderabad’s leading child specialists in a short span of time. Not satisfied with personal success he joined forces with his brother, Mr Ravinder Rao, an experienced business leader, to start Yashoda Labs.\r\n\r\nYashodha Group has come a long way since then, from a small clinic in Hyderabad, to a 1,000-plus-bed facility, with three hospitals at Secunderabad, Malakpet and Somajiguda. With a nursing school and college attached to each hospital. It has more than 450 doctors, 1,500 nurses and a total of 4,000 staff comprising of paramedical and other support staff.', 'Cardiology,Cardiothoracic Surgery,', 'Vijaya Labs are putting great\r\n effort in the field of hospital managements.', 'hospital.jpg', 'hosp.jpeg', 'hospital.jpg', 'hosp.jpeg', 'hosp.jpeg', '2012-12-01 00:00:00', '2013-01-02 11:15:40'),
(2, 2, 1, '\r\nAbout Us\r\n\r\nBrief History\r\n\r\nThe journey of Yashoda Labs started way back in 1989 as a small clinic, where Dr G Surender Rao practised paediatrics. With his international education and experience he became one of Hyderabad’s leading child specialists in a short span of time. Not satisfied with personal success he joined forces with his brother, Mr Ravinder Rao, an experienced business leader, to start Yashoda Hospitals.\r\n\r\nYashoda Group has come a long way since then, from a small clinic in Hyderabad, to a 1,000-plus-bed facility, with three hospitals at Secunderabad, Malakpet and Somajiguda. With a nursing school and college attached to each hospital. It has more than 450 doctors, 1,500 nurses and a total of 4,000 staff comprising of paramedical and other support staff.', 'Cardiology,Cardiothoracic Surgery', 'Yashodha Labs are putting greate effort in the field of Lab managements.', NULL, NULL, NULL, NULL, NULL, '2012-12-01 00:00:00', '2012-12-01 00:00:00');
