(20, 'Nandi Diagnostics', 'Hyderabad', '0', 28, 15, '5', '25 - Hydroxy Vitamin D3', 'Serum', 'Same Days', '48 Hrs', 'Vitamin D is a fat-solubie sterid hormone precursor that is mainly produced in the skin by exposure to sunlight or it is supplied via dietary sources(mainly egg yolk,fish oil and plants). Vitamin D is biologically inert and must dihydroxylate in position 25 forming 25-OH vitamin D. 25-OH vitamin Dis the metabolite that should be measured in blood to determine the overall vitamin D status because it is the major storage from of vitamin D in the human body. this primary circulating from of vitamin D is biologically inactive with ievels approximately 1000-fold greater than the circlating 1,25(OH)2vitamin D.The half life of circulating 25-OH vitamin D is 2-3 weeks.More than 95% of 25-OH vitamin D,measuarable in serum,is 25-OH vitamin D3 whereas 25-OH vitamin D2 reaches measurable levels only in patients taking vitamin D2 supplements. Vitamin D deficiency is a common cause of secondary hyperparathroidism.Elevations of PTH levels, especially in elderly vitamin Ddeficient adults can result in osteomalacia,increased bone turnover,reduced bone mass and risk of bone fractures. Low 25-OH vitamin D concentrations are also associated with lower bone mineral density. In conjuction with other clinical data, the result may be used as an aid in the assessment of bone metabolism. The Roche Coabs Vitamin D3(25-OH)assay employs a polyclonal antibody directed against vitamin D3.\r\n\r\nNOTE:-Clinical diagnosis should not be made on the findings of a single test result,but should integer both clinical and laboratory data.', 'R/F', '2,5', 'CLIA', '2012-11-07 11:17:42', '2013-01-18 12:15:58', 1, 'Days', '', '', ''),
