(497, 'Nandi Diagnostics', 'Hyderabad', '0', 28, 15, '482', 'Thyroid stimulating hormone (tsh)', 'Serum ', 'Same Day ', '', 'TSH is a 28,000 dalton  glycoprotein. It is secreted from the anterior lobe of the pituitary gland and induces the production of thyroxine (T4) and Triiodothyronine (T3) from the Thyroid gland .The normal level of TSH in the blood is extremely low, it is essential for the normal regulation of the Thyroid gland. TSH release is regulated by a TSH-Releasing Hormone (TRH) produced by the Hypothalamus.The level of TSH and TRH are inversely related to the level of Thyroid Hormones.when there are high levels of TSH in the blood, less TRH is released by the Hypothalamus and in turn less TSH is secreted by the pituitary. This process is known as a negative feedback mechanism and is responsible  for the maintenance of proper TSH levels in the blood.', 'A', 'Daily', 'Chemiluminescence ', '2012-11-12 05:54:08', '2013-01-10 13:47:36', NULL, 'Days', '', '', ''),
